//helper/wrapper class for matching function's data
class ColorMatchingFunction
{
public:
	MYFLOATTYPE startWavelength;
	MYFLOATTYPE stepWavelength;
	MYFLOATTYPE endWavelength;
	std::vector<MYFLOATTYPE> m_data;

	ColorMatchingFunction(MYFLOATTYPE start, MYFLOATTYPE step, std::vector<MYFLOATTYPE> data)
		:startWavelength(start), stepWavelength(step), m_data(data)
	{
		endWavelength = startWavelength + stepWavelength * (m_data.size() - 1);
	}
};

