ColorMatchingFunction function_LMS_S(390.0, 0.1, data_LMS_S);
ColorMatchingFunction function_XYZ_X(390.0, 0.1, data_XYZ_X);
ColorMatchingFunction function_XYZ_Y(390.0, 0.1, data_XYZ_Y);
ColorMatchingFunction function_XYZ_Z(390.0, 0.1, data_XYZ_Z);

MYFLOATTYPE ColorimetricLookup::lookup(MYFLOATTYPE wavelength, unsigned short int colorMatchingFunction)
{
	ColorMatchingFunction* currentFunction;

	switch (colorMatchingFunction)
	{
	case CLU_LMS_S:
		currentFunction = &function_LMS_S;
		break;
	case CLU_LMS_M:
		currentFunction = &function_LMS_M;
		break;
	case CLU_LMS_L:
		currentFunction = &function_LMS_L;
		break;
	case CLU_XYZ_X:
		currentFunction = &function_XYZ_X;
		break;
	case CLU_XYZ_Y:
		currentFunction = &function_XYZ_Y;
		break;
	case CLU_XYZ_Z:
		currentFunction = &function_XYZ_Z;
		break;
	default:
		std::cout << "Color Matching Function not found!\n";
		return 0;
		break;
	}

	if (wavelength < currentFunction->startWavelength || wavelength > currentFunction->endWavelength)
		return 0;

	int index = lroundf((wavelength - currentFunction->startWavelength) / currentFunction->stepWavelength);
	if (index > currentFunction->m_data.size()) __debugbreak();

	return MYFLOATTYPE(currentFunction->m_data[index]);
}
